import React from "react";
import { Link, withRouter } from "react-router-dom";

//style
import header from '/Users/shivanibrijmohan/Development/code/Mod5/bloc/bloc-front-end/src/style/header.css';

const Header = props => {
  return (
    <div>

    <header className="header">
    <div className="logo-box">
      <img src="https://png.pngtree.com/element_origin_min_pic/16/11/17/af6622752fa4cc38c5bc4baa00892643.jpg" alt="logo" className="logo"/>
    </div>
    </header>

    //Define our SVG clip path
    <svg width='0' height='0'>
      <defs>
        <clipPath id="cp" clipPathUnits="objectBoundingBox">
          <path d="M0.500, 0.945 L0.994, 0.090 L0.006, 0.090 L0.500, 0.945 L0.500, 0.650 L0.262, 0.238 L0.738, 0.237 L0.500, 0.650z"></path>
        </clipPath>
      </defs>
    </svg>

    // The actual elements we're using
    <div class="triangle first"></div>
    <div class="triangle second"></div>
  </div>
  );
};

export default withRouter(Header);
